import { useEffect, useState } from 'react';

function TodoList() {

  const [list, setList] = useState([]);
  useEffect(() => {

    fetch('http://localhost:3000/todo')
      .then(res => res.json())
      .then((arrayList) => setList(arrayList) );
  }, []);

  return(
    <div>
      <ul>
         <li> {list.map((task) => task)} </li>
      </ul>
    </div>
  );
}

export default TodoList;
